import React, { useState, useEffect } from "react";
import { makeStyles } from "@material-ui/core/styles";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faEdit } from "@fortawesome/free-solid-svg-icons";
import { useSelector, useDispatch } from "react-redux";
import setObraSocial from "actions/ObraSocialActions";

export default function SimpleTable() {
  const classes = useStyles();
  const dispatch = useDispatch();
  const [obrasSociales, setObrasSociales] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8080/obraSocial", {
      method: "GET",
      headers: { "Content-Type": "application/json" },
    })
      .then((response) => response.json())
      .then((data) => setObrasSociales(data));
  }, []);
  const editObraSocial = (cd_os, nombre) => {
    dispatch(setObraSocial({ cd_os: cd_os, nombre: nombre }));
  };
  return (
    <TableContainer component={Paper}>
      <Table aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell className={classes.titleTable}>Obras Sociales</TableCell>
            <TableCell align="right"></TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {obrasSociales.map((obraSocial) => {
            return (
              <TableRow key={obraSocial.nombre} className={classes.rowTable}>
                <TableCell component="th" scope="row">
                  {obraSocial.nombre}
                </TableCell>
                <TableCell align="right">
                  <FontAwesomeIcon
                    icon={faEdit}
                    onClick={() =>
                      editObraSocial(obraSocial.cd_os, obraSocial.nombre)
                    }
                  />
                </TableCell>
              </TableRow>
            );
          })}
        </TableBody>
      </Table>
    </TableContainer>
  );
}

const useStyles = makeStyles((theme) => ({
  table: {
    minWidth: 650,
  },
  titleTable: {
    fontSize: 16,
    textAlign: "center",
  },
  rowTable: {
    "&:hover": {
      backgroundColor: "#eeeeee",
      color: theme.palette.primary.main,
      cursor: "pointer",
    },
  },
}));
